import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

const counterModule = {
  // namespace the module
  namespaced: true,
  state: () => ({
      teste: 'teste em modules'
  })
}

export default new Vuex.Store({
   modules: {
    counterMod: counterModule
  }
})
